    public int lengthOfLongestSubstring(String s) {
        int n = s.length();
        int maxLength = 0;

        HashSet<Character> hashSet = new HashSet<>();
        for (int i = 0; i < n; i++) {
            int x = i;
            int y = i;

            hashSet.clear();

            while (y < n) {
                char c = s.charAt(y);
                if (!hashSet.contains(c)) {
                    hashSet.add(c);
                    y++;
                } else {
                    maxLength = Math.max(y - x, maxLength);
                    x = y;
                    hashSet.clear();
                }
            }
            maxLength = Math.max(maxLength, hashSet.size());
        }

        return maxLength;
    }
